import { actionType } from "../actions";
const initialState = {
  comments: []
};

export const rootReducer = (state = initialState, action) => {
  switch (action.type) {
    case actionType.ADD_CAR_EXP:
      return {
        ...state,
        car_expenses: [...state.car_expenses, action.payload]
      };
    default:
      return state;
  }
};
